        ie_origem_proced_p number,
        cd_material_p number,
	    ie_tipo_item_p varchar2
) return varchar2 is

ds_retorno_w		varchar2(255) := '';

begin

    if (ie_tipo_item_p = 'P' and cd_procedimento_p is not null) then
        ds_retorno_w := Obter_Desc_Proc_Inter(cd_procedimento_p, ie_origem_proced_p);
