        return '';
end tcel_obter_desc_item;
/

create or replace procedure tcel_limpa_coparticipacao(
                nr_interno_conta_p	number
) is
begin

    delete from tcel_cpg_cpac_item where nr_conta = nr_interno_conta_p;
    delete from tcel_cpg_cpac_autorizacao where nr_conta = nr_interno_conta_p;
    commit;
exception
    when others then
        rollback;

end tcel_limpa_coparticipacao;
/

create or replace function tcel_obter_dados_medico(
	cd_medico_p number,
	cd_convenio_p number,
    ie_tipo_info_p number
) return varchar2 is

/* 
ie_tipo_info_p
1 - código do médico no convênio
*/

ds_retorno_w		varchar2(255) := '';
cd_medico_convenio_w    medico_convenio.cd_medico_convenio%type;

begin


    select max(cd_medico_convenio)
    into cd_medico_convenio_w
    from medico_convenio 
    where cd_pessoa_fisica = cd_medico_p
    and cd_convenio = cd_convenio_p
    and (
    -- sem datas de vigência, ou dentro do intervalo
        (dt_inicio_vigencia is null and dt_final_vigencia is null)
        or (dt_inicio_vigencia is null and sysdate <= nvl(dt_final_vigencia, sysdate))
        or (dt_final_vigencia is null and sysdate >= nvl(dt_inicio_vigencia, sysdate))
        or (sysdate between nvl(dt_inicio_vigencia, sysdate) and nvl(dt_final_vigencia, sysdate))
    );

	if (ie_tipo_info_p = 1) then
	    ds_retorno_w := cd_medico_convenio_w;
	end if;

return	ds_retorno_w;

exception
	when others then
	    return null;

end tcel_obter_dados_medico;
/

