create or replace procedure tcel_calcular_coparticipacao_area(
                nr_interno_conta_p      number,
                nr_seq_area_p           number,
                pr_calculo_p            number,
                vl_calculo_p            number
) is

pr_calculo_w    cel_cpg_cpac_item.pr_cobertura_item%type;
vl_calculo_w    cel_cpg_cpac_item.vl_cobertura_item%type;
vl_total_item_w cel_cpg_cpac_item.vl_total_item%type;

begin
    if (pr_calculo_p is null and vl_calculo_p is null) then
        Wheb_mensagem_pck.exibir_mensagem_abort(obter_desc_expressao(1142146));
    end if;

    select round((nvl(sum(a.vl_cobertura_item), 0) / nullif(sum(a.vl_total_item), 0)) * 100, 2),
        sum(a.vl_cobertura_item),
        sum(a.vl_total_item)
    into pr_calculo_w,
        vl_calculo_w,
        vl_total_item_w
    from tcel_cpg_cpac_item a
    where a.nr_seq_area = nr_seq_area_p
    and a.nr_conta = nr_interno_conta_p;

    if (pr_calculo_p = pr_calculo_w and vl_calculo_p = vl_calculo_w) then
        Wheb_mensagem_pck.exibir_mensagem_abort(obter_desc_expressao(1142146));
    end if;

    if (pr_calculo_p != pr_calculo_w and vl_calculo_p != vl_calculo_w) then
        Wheb_mensagem_pck.exibir_mensagem_abort(obter_desc_expressao(1142147));
    end if;

    if (vl_calculo_p is not null) then
        pr_calculo_w := round((nvl(vl_calculo_p, 0) / nullif(vl_total_item_w, 0)) * 100, 2);
    end if;

    if (pr_calculo_p is not null) then
        pr_calculo_w := pr_calculo_p;
    end if;

    Wheb_mensagem_pck.exibir_mensagem_abort('Percentual para calculo: ' || pr_calculo_w);

end tcel_calcular_coparticipacao_area;
/

