CREATE OR REPLACE TRIGGER tcel_cpg_cpac_item_before_update
BEFORE UPDATE ON tcel_cpg_cpac_item
FOR EACH ROW
DECLARE
    vl_cobertura_w  tcel_cpg_cpac_item.vl_cobertura_item%TYPE;
BEGIN
    -- Recalcula sempre que o percentual ou o valor total mudarem
    IF NVL(:NEW.pr_cobertura_item, -1) != NVL(:OLD.pr_cobertura_item, -1)
       OR NVL(:NEW.vl_total_item, -1) != NVL(:OLD.vl_total_item, -1) THEN

        vl_cobertura_w := ROUND((NVL(:NEW.pr_cobertura_item, 0) / 100) * NVL(:NEW.vl_total_item, 0), 2);

        :NEW.vl_cobertura_item := vl_cobertura_w;
        :NEW.vl_diferenca_item := :NEW.vl_total_item - vl_cobertura_w;
    END IF;
END;
