    nm_usuario_p		in conta_paciente.nm_usuario%type
) is

nr_conta_filha_w	conta_paciente.nr_interno_conta%type;

begin

--Verifica se a conta em questão ja foi processada
	select nvl(max(nr_interno_conta), 0)
	into nr_conta_filha_w
	from conta_paciente
	where nr_seq_conta_origem = nr_interno_conta_p;

	if (nr_conta_filha_w = 0)  then
		Wheb_mensagem_pck.exibir_mensagem_abort(obter_desc_expressao(1143087));
	end if;

--deleta os dados da conta filha
	delete from procedimento_paciente
	where nr_interno_conta = nr_conta_filha_w;

	delete from material_atend_paciente
	where nr_interno_conta = nr_conta_filha_w;

	delete from conta_paciente
	where nr_interno_conta = nr_conta_filha_w;


--retorna os valores do procedimento para os valores originais na conta principal
    update procedimento_paciente p
    set (p.vl_procedimento, p.nm_usuario) = (
        select v.vl_procedimento, nm_usuario_p
