CREATE OR REPLACE TRIGGER tcel_cpg_cpac_item_before_update
BEFORE UPDATE ON tcel_cpg_cpac_item
FOR EACH ROW
DECLARE
    vl_cobertura_w  tcel_cpg_cpac_item.vl_cobertura_item%TYPE;
    pr_cobertura_w  tcel_cpg_cpac_item.pr_cobertura_item%TYPE;
BEGIN

    IF SYS_CONTEXT('USERENV', 'CLIENT_IDENTIFIER') = 'SKIP_TCEL_PROCESSAR_CONTA_REP_DOM_INSERT' THEN
        RETURN;
    END IF;

-- Executa as validações apenas se NÃO for para ignorar
        IF NVL(SYS_CONTEXT('USERENV', 'CLIENT_IDENTIFIER'), 'NULL') != 'SKIP_TCEL_PROCESSAR_CONTA_REP_DOM' THEN

        if (NVL(:NEW.pr_cobertura_item, -1) = NVL(:OLD.pr_cobertura_item, -1) and NVL(:NEW.vl_cobertura_item, -1) = NVL(:OLD.vl_cobertura_item, -1)) then
            Wheb_mensagem_pck.exibir_mensagem_abort(obter_desc_expressao(1142146));
        end if;

        if (NVL(:NEW.pr_cobertura_item, -1) !=  NVL(:OLD.pr_cobertura_item, -1) and NVL(:NEW.vl_cobertura_item, -1) != NVL(:OLD.vl_cobertura_item, -1)) then
            Wheb_mensagem_pck.exibir_mensagem_abort(obter_desc_expressao(1142147));
        end if;

        if (NVL(:NEW.pr_cobertura_item, -1) > 100) then
            Wheb_mensagem_pck.exibir_mensagem_abort(obter_desc_expressao(506090));
        end if;

        if (NVL(:NEW.pr_cobertura_item, -1) <= 0 and NVL(:NEW.vl_cobertura_item, -1) is null) then
            Wheb_mensagem_pck.exibir_mensagem_abort(obter_desc_expressao(1142237));
        end if;

        if (NVL(:NEW.vl_cobertura_item, -1) > NVL(:NEW.vl_total_item, -1)) then
            Wheb_mensagem_pck.exibir_mensagem_abort(obter_desc_expressao(1142236));
        end if;

        if (NVL(:NEW.vl_cobertura_item, -1) <= 0 and NVL(:NEW.pr_cobertura_item, -1) is null) then
            Wheb_mensagem_pck.exibir_mensagem_abort(obter_desc_expressao(1142238));
        end if;

        IF NVL(:NEW.vl_cobertura_item, -1) != NVL(:OLD.vl_cobertura_item, -1)
            OR NVL(:NEW.vl_total_item, -1) != NVL(:OLD.vl_total_item, -1) THEN

            pr_cobertura_w := (nvl(NVL(:NEW.vl_cobertura_item, -1), 0) / nullif(NVL(:NEW.vl_total_item, -1), 0)) * 100;

            :NEW.pr_cobertura_item := pr_cobertura_w;
            :NEW.vl_diferenca_item := :NEW.vl_total_item - :NEW.vl_cobertura_item;
        END IF;

    END IF; -- fim da verificação de skip

    -- Recalcula sempre que o percentual ou o valor total mudarem
    IF NVL(:NEW.pr_cobertura_item, -1) != NVL(:OLD.pr_cobertura_item, -1)
       OR NVL(:NEW.vl_total_item, -1) != NVL(:OLD.vl_total_item, -1) THEN

        vl_cobertura_w := ROUND((NVL(:NEW.pr_cobertura_item, 0) / 100) * NVL(:NEW.vl_total_item, 0), 2);

        :NEW.vl_cobertura_item := vl_cobertura_w;
        :NEW.vl_diferenca_item := :NEW.vl_total_item - vl_cobertura_w;
    END IF;

END;
/

